package main

import "fmt"

func findMaxConsecutiveOnes(nums []int) int {
	max := 0
	counter := 0
	for _, v := range nums {
		if v == 1 {
			counter++
		} else {
			if counter > max {
				max = counter
			}
			counter = 0
		}
		// fmt.Printf("index: %d, counter: %d, max: %d\n", i, counter, max)
	}

	if counter > max {
		max = counter
	}

	return max
}

func findMaxConsecutiveOnes2(a []int) int {
	best, crt := 0, 0
	for _, v := range a {
		if crt+v > best {
			best = crt + v
		}
		crt = (crt + v) * v
	}
	return best
}

